du.\n\n\n\nBasic Info\nAge: 31\nHeight: 6\u00270 (183 cm)\nLooking for: Monogamous relationship, interested in women.\nLocation: Philadelphia, PA. Open to moving anywhere within the US, but probably not internationally. Open to a long-distance relationship in the short-term, as long as the plan is to eventually settle down in the same location.\nGIANT RED FLAG: I was previously married and it didnâ€™t work out, so we ended it on good terms. Completely understand if this is a dealbreaker for some people.\n\n\n\nCareer / Hobbies / Interests\nI currently work as a computational biologist at a research lab at UPenn. Basically get paid to work on interesting problems all day, so it\u0027s pretty cool. But part of me kinda wants to be building something rather than doing purely academic research, so I may eventually try to switch over to biotech.\nOutside of work, one of my favorite hobbies is teaching. For example:\nI have an educational Youtube channel with tutorial videos about computational biology and programming.\nI sometimes teach in-person classes at Fractal University, a cool community-based proto-university in NYC. (Iâ€™m also trying to start something similar in the Philly area.) \nAlso, sometimes people ask me to teach Python-for-Biologists workshops, and I\u0027m happy to do this for free. For example, I recently taught a 6-hour virtual workshop for a university in Pakistan that invited me. \nIâ€™m partly doing this just for fun, but itâ€™s also part of a broader interest in alternative, non-traditional education. I basically agree with all the usual criticisms of the current education system, but I also have this Chestertonâ€™s-fence-esque belief that you shouldn\u0027t knock down an institution until youâ€™ve successfully built something better to replace it (which might be harder than it sounds).\nBesides teaching for fun, I also like learning for fun. I especially like to learn how things work from scratch (like neural nets, statistical tests, market economies, compilers, or computers).\nI like a lot of the usual ACX / LessWrong / rationalist stuff, for example:\nSome public thinkers I find interesting (though don\u0027t 100% agree with all the time): Scott Alexander, Eliezer Yudkowsky, Julia Galef, Aella, Dwarkesh Patel, Bryan Caplan, Tyler Cowen, Robin Hanson, Sam Harris\nSome topics I find interesting: prediction markets, forecasting, machine learning, decision theory, probability brain teasers, meta-science\nOther hobbies: \nrunning / fitness\nwatching movies (especially horror / thrillers / mysteries)\nwalking around (could be a hike or exploring a city)\nweekend roadtrips\nplaying guitar. I used to play saxophone too, and kinda want to get back into that.\n\n\n\nBeliefs and Values\nPolitical views: Center-right. Classical liberalism, markets, civil liberties, freedom of speech, science, secularism, entrepreneurship, techno-optimism, etc. libertarian-ish, but closer to Tyler Cowen than Ron Paul. \nReligious views: agnostic/atheist, but not hardcore about it. somewhat \"culturally Christian.\" open to raising kids in a religious tradition if it means a lot to you.\nVegetarian (it\u0027s fine if you\u0027re not though)\nThings I agree with effective altruists about: malaria prevention, effective giving, animal welfare, etc.\nThings I disagree with effective altruists about: AI risk/benefit\n^ I try not to be too preachy or argumentative about any of these things, and am certainly open to dating people who don\u0027t share these views.\n\n\n\nAbout You (Hopefully)\nSomeone whoâ€™s interested in a serious, monogamous relationship and eventually settling down together. Iâ€™m not really looking for casual dating or hookups.\nSomeone whoâ€™s interested in having kids. Ideally Iâ€™d like to have at least 2 kids (because itâ€™s nice to have a sibling), and am open to having more if youâ€™d like.\nSomeone whoâ€™s kind, gentle, caring, honest.\n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_lhs":1,"ds_df":{"df_dm":
